import { RouteProps, Route, Navigate } from "react-router-dom";
import { ComponentType } from "react";

interface PrivateRouteProps extends Omit<RouteProps, "element"> {
  component: ComponentType;
  isLoggedIn: boolean;
}

const PrivateRoute = ({
  component: Component,
  isLoggedIn,
  ...rest
}: PrivateRouteProps) => {
  return (
    <Route
      {...rest}
      element={isLoggedIn ? <Component /> : <Navigate to="/login" replace />}
    />
  );
};

export default PrivateRoute;
